export default Index;

const Contenedor = (props) => {
    return (
        <div style={{
            background:"yellow",
            textAlign:"center"
        }}>
            {props.children}
        </div>
    )
}

function Figura1() {
    return (
        <img src="./static/logo-login.png" alt="" height="200" width="200"/>
    );
}

function Seccion1() {
    return (
        <section>
            <h2>Ésta es la sección 1</h2>
            <Figura1/>
        </section>
    );
}

function Index() {
    return (
        <Contenedor>
            <h1>Bienvenidos a mi aplicación React JS</h1>
            <p>Ésta es mi primera app con React JS</p>
            <Seccion1/>
        </Contenedor>
    );
}
